import React from 'react';

const Toolbar: React.FC = () => {
    return (
        <div style={{ 
            height: 50, 
            border: '0px solid #444', 
            padding: '8px 16px', 
            background: '#151515ff',
            display: 'flex',
            alignItems: 'center',
            gap: 16,
            color: '#ffffff'
        }}>
            <h2 style={{ margin: 0, fontSize: 28, color: '#ffffff' }}>Fuck Vishnu</h2>
            <button style={{ 
                padding: '4px 12px',
                backgroundColor: '#455c53ff',
                color: '#ffffff',
                border: '1px solid #455c53ff',
                borderRadius: '4px',
                cursor: 'pointer'
            }}>Save</button>
            <button style={{ 
                padding: '4px 12px',
                backgroundColor: '#455c53ff',
                color: '#ffffff',
                border: '1px solid #455c53ff',
                borderRadius: '4px',
                cursor: 'pointer'
            }}>Load</button>
            <button style={{ 
                padding: '4px 12px',
                backgroundColor: '#455c53ff',
                color: '#ffffff',
                border: '1px solid #455c53ff',
                borderRadius: '4px',
                cursor: 'pointer'
            }}>Clear</button>
        </div>
    );
};

export default Toolbar;
